DESCRIPTION:
Es una entidad de derecho privado dependiente del Ministerio de Agricultura, cuya principal tarea es administrar la política forestal de Chile y fomentar el desarrollo del sector.

La Corporación está dirigida por un director ejecutivo, en la actualidad don José Manuel Rebolledo, y tiene la misión de contribuir al desarrollo del país a través del manejo sostenible de los ecosistemas forestales y de los componentes de la naturaleza asociados a éstos, la que se alcanzará mediante:
-          El fomento, el establecimiento, restauración y manejo de los bosques y formaciones xerofíticas;
-          El aumento del arbolado urbano;
-          La mitigación y adaptación de los efectos del cambio climático;
-          La fiscalización de la legislación forestal y ambiental;
-          La protección de los recursos vegetacionales y la administración de las Áreas Silvestres Protegidas del Estado, para las actuales y futuras generaciones.

Es un servicio público centralizado creado mediante la Ley N° 19.147 de 1992, que tiene por objeto proporcionar información regional, nacional e internacional para que los distintos agentes involucrados en la actividad silvoagropecuaria adopten sus decisiones.
Se le encomienda, además, apoyar la gestión del Ministerio de Agricultura a través de: (a) 
Prestar servicios de información gratuitos de interés sobre la actividad agropecuaria, a través de publicaciones, estadísticas, informes, estudios, noticias, entre otros; (b) Participar en la definición de criterios destinados a sustentar la posición negociadora del país en materia de comercio exterior sectorial, en coordinación con el Ministerio de Relaciones Exteriores u otros organismos públicos que cumplan funciones relacionadas; (c) Colaborar en la coordinación de los programas de asistencia técnica y de cooperación internacional;
Evaluar los proyectos presupuestarios de los servicios del sector, los que somete a la aprobación del Ministro y efectúa el seguimiento de su gestión programática y presupuestaria; (e) Efectuar estudios de la realidad silvoagropecuaria, detectar los problemas y emergencias que la afectan, evalúar y proponer soluciones;
Asesorar al Ministro y al Subsecretario en materias pertinentes.
Además, fortalecer la gestión del Ministerio de Agricultura y de los agentes públicos y privados involucrados en el ámbito silvoagropecuario, a través de la prestación de servicios especializados de asesoría e información.

1. Asesorar técnica y políticamente al Gobierno Central, Gobiernos Regionales y otras instituciones públicas con el fin de crear competencias y promover el Desarrollo Territorial;
2. Apoyar y asistir a las Regiones
3. Administrar los programas de Desarrollo Regional financiados en forma local o por créditos de Organismos Multilaterales.
